import { Component, useState } from "react";
import "./App.css";
import logo_orange from "./logo/logo_orange.png";
import Button from "@mui/material/Button";
import ButtonGroup from "@mui/material/ButtonGroup";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
//검색과 지도 선택에 사용될 useState
cosnt[(flag, changeFlag)] = useState(0);
class App extends Component {
  render() {
    const back = {
      backgroundColor: "grey",
    };
    return (
      <div className="App">
        <body className="Body">
          <header className="Nav">
            <img src={logo_orange} className="Logo" />
          </header>
          <Box
            sx={{
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
              "& > *": {
                m: 2,
              },
            }}
          >
            <ButtonGroup
              size="large"
              variant="text"
              aria-label="text button group"
              color="warning"
            >
              <Button>검색</Button>
              <Button>지도</Button>
            </ButtonGroup>
          </Box>
          <Box
            component="form"
            sx={{
              "& .MuiTextField-root": { m: 1, width: "25ch" },
            }}
            noValidate
            autoComplete="off"
          >
            <TextField
              id="standard-search"
              label="Search field"
              type="search"
              variant="standard"
              color="warning"
              focused
            />
          </Box>
        </body>
      </div>
    );
  }
}

export default App;
